  return( 
  <div>
    <SideNav/>
    <div style={{ display: "grid", gridTemplateColumns: "repeat(3, minmax(auto, 1fr))", gridGap: "10px"}}>
     <AllPosts/>
    </div>
    <UserProfile/>
  </div>
)
}
